import React from 'react'
import Button from '@material-ui/core/Button';

const Materialui = () => {
    function func1 (){
        alert("hii")
    }
    return (
        <>  
            
            <Button color="secondary" variant="outlined" href="https://material-ui.com/api/button/">click me</Button>

            <Button onClick={() => { alert('clicked') }}>Click me</Button>

            <button onClick={func1} >clickme</button>
           
        </>
    )
}

export default Materialui
